import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <div id="WatchListContainer"></div>
      <div id="WatchList"></div>
      <div id="FormContainer"></div>
      <div id="Stock-Display"></div>
    </div>
  );
}

export default App;
